import React from "react";
import SpaWrapper from "./spaWrapper";
import Header from "./header";

export default function App() {
  return (
    <SpaWrapper>
      <Header />
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>
    </SpaWrapper>
  );
}
